import React from 'react';
import '../styles/Card.scss';
import PostList from '../components/PostList';

function Card(){
        return(
            <div>
                <div className="card-inner">
                    <ul>
                        {
                            PostList.map(function(list){
                                return(
                                    <li>
                                        <li>
                        <div className="profile">
                        <div className="profile-bg">
                            <img className="smile" alt="smile" src={ require('../imgs/shy-smile.png')} />
                        </div>
                        <div className="inform">
                            <div className="nick-name">{PostList[0].writerNickName}</div>
                            <div className="condition">{PostList[0].categoryName} • 1분전</div>
                        </div>
                        </div>
                        <div className="post">
                            <div className="post-title">{PostList[0].title}</div>
                            <div className="post-content">{PostList[0].content}</div>
                            <img className="post-img" alt="post-img" src={ require('../imgs/shy-smile.png')} />
                                <ul className="post-state">
                                    <li>
                                        <img className="eye" alt="eye" src={ require('../imgs/eye.png')} />
                                        {PostList[0].viewCount}
                                    </li>
                                    <li>
                                        <img className="thumb" alt="thumb" src={ require('../imgs/thumb.png')} />
                                        {PostList[0].likeCount}
                                    </li>
                                    <li>
                                        <img className="talk" alt="talk" src={ require('../imgs/talk.png')} />
                                        {PostList[0].commentCount}
                                    </li>
                                </ul>
                            </div>
                        </li>
                                    </li>
                                )
                            })
                        }  
                    </ul>
                    
                </div>
            </div>
        )
}
export default Card;
